'''Party Pete''' is the founder and owner of the [[Falador Party Room]], and the first offspring of the Pete Family. He features in several [[Holiday events|events]], the most notable being the [[2017 Birthday event]].

Talking to him reveals more information about the Party Room. Additionally, you can purchase [[Game book|Party Pete's Bumper Book of Games]]. He is one of the few [[non-player character]]s to adorn a [[Red partyhat|partyhat]].

Occasionally, [[Postie Pete]] drops by to deliver some mail and wish his brother hello, to which Party Pete strikes up a conversation.

==2017 Birthday event==
On the fourth annual [[Birthday event]] for ''[[Old School RuneScape]]'', Pete decided to throw a "birthday bash" at his party room, and invited several important characters from around [[Gielinor]]. Despite his positive intentions, the patrons of the party seemed unbecoming of what the celebration had to offer, thus prompting him to ask for the [[Account|player's]] assistance once again.
[[File:2017 Birthday event - Party Pete's dance.gif|thumb|left|Party Pete out-dancing the Mugger.]]
Eventually, when the player has sorted out the patrons' moods, a wild [[mugger]] appears, and threatens to kill some of the patrons. Luckily, Pete exhibited his knowledge in the "Mugger code", by challenging the convict to a dance-off, a challenge which they cannot refuse.

Exhibiting his superior dance prowess, Pete out-dances the mugger thus saving the party.

